import "./Intro.css";

const Step = ({num}) => {
    return (
        <div class = "step">
          <div class = "step_img">
            Sample image가 들어갈 자리입니다.
          </div>
          <h2> STEP {num} </h2>
          <p> text가 들어갈 자리입니다. </p>
        </div>
    );
}


const Intro = () => {
  return (
    <div class = "intro">
        <div class = "left-box">
          class
        </div>
        <div class = "right-box">
          <Step num = "1" />
        </div>
    </div>
  );
}

export default Intro;
